contracts/DVTS.sol.content:
pragma solidity ^0.4.17;

contract DVTS {

    struct User{
        string UAEId;
        string name;
        string gender;
        string phoneNo;
        string addr;
        string bloodClassification;
        string nomineeName;
        string nomineeContact;
        //string prescription;
        //string description;
        //string diagnosis;
        address Eaddr;
        uint date; 
    }

    struct MoH{
        string name;
        string phoneNo;
        string addr;
        address Eaddr;
        uint date;  
    }

    struct Doctor{
        string UAEId;
        string name;
        string gender;
        string phoneNo;
        string addr;
        string bloodClassification;
        string description;
        //uint creationDate;
        address Eaddr;
        uint date; 
    }

    struct Orgs{
        string name;
        string phoneNo;
        string addr;
        address Eaddr;
        uint date;  
    }

    address public owner;
    address[] public userList;
    address[] public doctorList;
    address[] public orgsList;
    

    mapping(address => User) users;
    mapping(address => Doctor) doctors;
    mapping(address => Orgs) orgs;

    mapping(address=>mapping(address=>bool)) isApproved;
    mapping(address => bool) isUser;
    mapping(address => bool) isDoctor;
    //mapping(address => bool) isMoH;
    mapping(address => uint) isOrgs;

    uint256 public userCount = 0;
    uint256 public doctorCount = 0;
    uint256 public orgsCount = 0;
    uint256 public permissionGrantedCount;

    function DVTS() public {
        //msg.sender is the owner of the contract. 
        //If you have a variable defined in your contract by the name of "owner", you can assign it with the value(address) of msg.sender.
        owner = msg.sender;
    }

    //This function will make the user able to edit their data
    function registrationUser(string _UAEId, string _name, string _gender, string _phoneNo, string _addr, string _bloodClassification, string _nomineeName, string _nomineeContact) {
        require(!isUser[msg.sender]);
        var u = users[msg.sender];

        u.UAEId = _UAEId;
        u.name = _name;
        u.phoneNo = _phoneNo;
        u.gender = _gender;
        u.addr = _addr;
        u.bloodClassification = _bloodClassification;
        u.nomineeName= _nomineeName;
        u.nomineeContact = _nomineeContact;
        u.Eaddr = msg.sender;
        u.date = block.timestamp; 

        userList.push(msg.sender);
        isUser[msg.sender] = true;
        userCount++;
    }

    function modifyUser(string _phoneNo, string _addr, string _nomineeName, string _nomineeContact) {
        require(isUser[msg.sender]);
        var u = users[msg.sender];

        u.phoneNo = _phoneNo;
        u.addr = _addr;
        u.nomineeName= _nomineeName;
        u.nomineeContact = _nomineeContact;
        u.Eaddr = msg.sender;
    }

        function registrationDoctor(string _UAEId, string _name, string _gender, string _phoneNo, string _addr, string _bloodClassification, string _description) {
        require(!isDoctor[msg.sender]);
        var d = doctors[msg.sender];

        d.UAEId = _UAEId;
        d.name = _name;
        d.phoneNo = _phoneNo;
        d.gender = _gender;
        d.addr = _addr;
        d.bloodClassification = _bloodClassification;
        d.description = _description;

        d.Eaddr = msg.sender;
        d.date = block.timestamp; 

        
        doctorList.push(msg.sender);
        isDoctor[msg.sender] = true;
        doctorCount++;
    }

    function modifyUser(string _phoneNo, string _addr) {
        require(isDoctor[msg.sender]);
        var d = doctors[msg.sender];

        d.phoneNo = _phoneNo;
        d.addr = _addr;
        d.Eaddr = msg.sender;
    }

    function grantPermission(address _addr) public returns(bool success) {
        isApproved[msg.sender][_addr] = true;
        permissionGrantedCount++;
        return true;
    }

    function removePermission(address _addr) public returns(bool success) {
        isApproved[msg.sender][_addr] = false;
        return true;
    }

    function getUsers() public view returns(address[]) {
        return userList;
    }

    function getDoctors() public view returns(address[]) {
        return doctorList;
    }

    function searchUserDetails(address _address) public view returns(string, string, string) {
        require(isApproved[_address][msg.sender]);

        var ud = users[_address];

        return (ud.UAEId, ud.name, ud.gender);
    }

    function searchUserMedical(address _address) public view returns(string, string, string, string) {
        require(isApproved[_address][msg.sender]);

        var um = users[_address];

        return (um.addr, um.bloodClassification, um.nomineeName ,um.nomineeContact);
    }

    function searchDoctor(address _address) public view returns(string, string, string, string, string){
        require(isDoctor[_address]);

        var sd = doctors[_address];
        return (sd.UAEId, sd.name, sd.phoneNo, sd.gender, sd.description);
    }

    function searchUserRecordDate(address _address) public view returns(uint) {
        var ur = users[_address];

        return (ur.date);
    }

    function searchDoctorRecordDate(address _address) public view returns(uint) {
        var dd = doctors[_address];

        return (dd.date);
    }

    function getUserCount() public view returns(uint256) {
        return userCount;
    }

    function getDoctorCount() public view returns(uint256) {
        return doctorCount;
    }

    function getPermissionGrantedCount() public view returns(uint256) {
        return permissionGrantedCount;
    }
}

